import React from 'react';
import logosolo2 from './logosolo2.png';

const Cabecera = () => {
return (

  <header>
<div classNameName='flex justify-between '>

    <div className="flex dib">
        <a href="https://github.com/" ><img alt='logo' classNameName="ph4 dib br2 br--top " src={logosolo2} /></a>
    </div>
    <div className="flex ">
        <a className="f6 dib white bg-animate hover-bg-white hover-black no-underline pv2 ph4 mh2 br-pill ba b--white-20" href="https://www.google.com">About</a>
        <a className="f6 dib white bg-animate hover-bg-white hover-black no-underline pv2 ph4 mh2 br-pill ba b--white-20" href="https://www.google.com">Contacto</a>
        <a className="f6 dib white bg-animate hover-bg-white hover-black no-underline pv2 ph4 mh2 br-pill ba b--white-20" href="https://www.google.com">Blog</a>
    </div>


</div>
  </header>

);
}

export default Cabecera;
